#include "bpFileReaderScene.h"
#include "bpFileTools.h"

#include "../src/bpThumbnailReader.h"

#include <hdf5.h>

#include <fstream>


static bpString GetDefaultSceneThumbnail();


static bool groupExists(hid_t parent, const char* aDirectoryName)
{
  return H5Lexists(parent, aDirectoryName, H5P_LINK_ACCESS_DEFAULT) > 0;
}


bpFileReaderScene::bpFileReaderScene(const bpString& aFileName)
  : bpFileReader({}),
    mFileName(aFileName)
{
  bpString vExt = bpToLower(bpFileTools::GetExt(aFileName));
  if (vExt == "imx") {
    CheckImxScene(aFileName);
  }
  else if (vExt == "ims") {
    CheckImsScene(aFileName);
  }
  else {
    throw std::runtime_error("Unknown format extension");
  }
}


std::vector<bpString> bpFileReaderScene::GetAllFileNamesOfDataSet()
{
  return{ mFileName };
}


bpString bpFileReaderScene::GetDescription() const
{
  return GetFormatDescription();
}


bpSharedPtr<bpThumbnail> bpFileReaderScene::ReadThumbnail() const
{
  // do not read from file, as it probably contains a thumbnail of the associated image and no info about the scene
  static bpSharedPtr<bpThumbnail> vThumbnail = bpThumbnailReader::ReadThumbnailFromData(GetDefaultSceneThumbnail());
  return vThumbnail ? std::make_shared<bpThumbnail>(*vThumbnail) : bpSharedPtr<bpThumbnail>();
}


std::vector<bpString> bpFileReaderScene::GetFileExtension()
{
  return GetFileFormatExtension();
}


bpString bpFileReaderScene::GetFormatDescription()
{
  return "Bitplane: Imaris Scene File";
}


std::vector<bpString> bpFileReaderScene::GetFileFormatExtension()
{
  return{ "imx", "ims" };
}


void bpFileReaderScene::CheckImxScene(const bpString& aFileName)
{
#ifdef _WIN32
  std::ifstream vFile(bpFromUtf8(aFileName));
#else
  std::ifstream vFile(aFileName);
#endif
  std::string vLine;
  for (bpSize vIndex = 0; vIndex < 3; ++vIndex) {
    if (!std::getline(vFile, vLine)) {
      throw std::runtime_error("Could not read imx scene");
    }
    if (vLine.empty()) {
      --vIndex;
    }
    if (vLine.find("<bpImarisApplication") != bpString::npos) {
      return;
    }
  }
  throw std::runtime_error("Imx scene not found");
}


void bpFileReaderScene::CheckImsScene(const bpString& aFileName)
{
  hid_t vFile = H5Fopen(aFileName.c_str(), H5F_ACC_RDONLY, H5P_DEFAULT);
  if (vFile == H5I_INVALID_HID) {
    throw std::runtime_error("Not an hdf5 file");
  }
  if (groupExists(vFile, "DataSet")) {
    throw std::runtime_error("Found ims image");
  }
  if (!groupExists(vFile, "Scene") && !groupExists(vFile, "Scene8")) {
    throw std::runtime_error("Ims scene not found");
  }
}


